import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

export default function Flipic() {
  return (
    <>
    <h1 className='Flipic'>Flipic</h1>
    {/* <p1> Flipic is cool</p1> */}
    <Flipic_Cards />

    {/* <HeroSection /> */}
    <Footer />
  </>
  );
}

function Flipic_Cards() {
  return (
    <div className='cards'>
      <h1>Check out my EPIC Projects!</h1>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src='images/img-3.jpg'
              text='Financial Market Trading App'
              label='Mketbot'
              path='/MketBot'
            />
            <CardItem
              src='images/img-4.jpg'
              text='Like Tinder for Making Tricky Choices!'
              label='Flipic'
              path='/Flipic'
            />
            <CardItem
              src='images/img-8.jpg'
              text='Compassion Training Support Application'
              label='Doctra'
              path='/Doctra'
            />
          </ul>
        </div>
      </div>
    </div>
  );
}
